[Form]
public class FBCIAPAssetTransCreateFromFiscalDoc_BR extends FormRun
{
    FiscalEstablishment_BR                      fiscalEstablishment;
    FBCIAPAssetTransCreateFromFiscalDoc_BR      ciapAssetTransCreateFromFiscalDoc;
    FBICMSAdjustmentCreateFromFiscalDoc_BR      icmsAdjustmentCreateFromFiscalDoc;
    str                                         recidsAlreadySelected;

}

	public boolean canClose()
    {
		boolean ret;

        ret = super();

        if (icmsAdjustmentCreateFromFiscalDoc)
        {
            ret = element.validateOneFiscalDocumentSelected();
        }

        return ret;
    }

public boolean closedOk()
{
    boolean ret;
    boolean hasSelectedInvoices;

    ret = super();

    ttsBegin;

    if (ciapAssetTransCreateFromFiscalDoc)
    {
        hasSelectedInvoices = element.transferToCiapTrans();

        if (hasSelectedInvoices && Box::yesNo("@SYS4001758", DialogButton::Yes))
        {
            ciapAssetTransCreateFromFiscalDoc.updateICMSValues();
        }
    }
    else if (icmsAdjustmentCreateFromFiscalDoc)
    {
        element.transferToTaxAdjustmentJournal();
    }

    ttsCommit;

    return ret;
}

/// <summary>
/// Returns the RecIds of the fiscal documents already referenced.
/// </summary>
/// <returns>String with the recIds to be passed to QueryBuildRange.value method.</returns>
public str getRecIdsAlreadySelected()
{
    return recidsAlreadySelected;
}

public void init()
{
    Object caller;
    super();

    caller = element.args().caller();

    if (caller == null)
    {
        throw error("@SYS22539");
    }

    if (caller is FBCIAPAssetTransCreateFromFiscalDoc_BR)
    {
        ciapAssetTransCreateFromFiscalDoc = caller;

        switch (ciapAssetTransCreateFromFiscalDoc.parmCiapAssetTrans().TransType)
        {
            case FBCIAPAssetTransType_BR::IM :
                TabPageCustomer.visible(false);
                TabPageVendor.visible(true);
                break;

            case FBCIAPAssetTransType_BR::ATSale :
            case FBCIAPAssetTransType_BR::ATTransfer :
            case FBCIAPAssetTransType_BR::OT :
                TabPageCustomer.visible(true);
                TabPageVendor.visible(false);
                break;
        }

        fiscalEstablishment = ciapAssetTransCreateFromFiscalDoc.getFiscalEstablishment();

        recidsAlreadySelected = ciapAssetTransCreateFromFiscalDoc.getRecIdsAlreadySelected();
    }
    else if (caller is FBICMSAdjustmentCreateFromFiscalDoc_BR)
    {
        icmsAdjustmentCreateFromFiscalDoc = caller;

        fiscalEstablishment = icmsAdjustmentCreateFromFiscalDoc.getFiscalEstablishment();

        TabPageCustomer.visible(true);
        TabPageVendor.visible(true);
    }
    else
    {
        throw error(error::wrongUseOfFunction(funcName()));
    }
}

private boolean transferToCiapTrans()
{
    InvoicesReferencedByMap_BR invoiceMap;
    FiscalDocumentLine_BR fiscalDocumentLine;
    boolean hasSelectedInvoices;

    for (invoiceMap = fiscalDocument_br_customer_ds.getFirst(1); invoiceMap; invoiceMap =  fiscalDocument_br_customer_ds.getNext())
    {
        for (fiscalDocumentLine = FiscalDocumentLine_BR_Customer_ds.getFirst(1); fiscalDocumentLine; fiscalDocumentLine =  FiscalDocumentLine_BR_Customer_ds.getNext())
        {
            ciapAssetTransCreateFromFiscalDoc.addFromInvoiceMap(invoiceMap, fiscalDocumentLine);
            hasSelectedInvoices = true;
        }
    }

    for (invoiceMap = fiscalDocument_br_vendor_ds.getFirst(1); invoiceMap; invoiceMap =  fiscalDocument_br_vendor_ds.getNext())
    {
        for (fiscalDocumentLine = FiscalDocumentLine_BR_Vendor_ds.getFirst(1); fiscalDocumentLine; fiscalDocumentLine =  FiscalDocumentLine_BR_Vendor_ds.getNext())
        {
            ciapAssetTransCreateFromFiscalDoc.addFromInvoiceMap(invoiceMap, fiscalDocumentLine);
            hasSelectedInvoices = true;
        }
    }

    return hasSelectedInvoices;
}

private void transferToTaxAdjustmentJournal()
{
    InvoicesReferencedByMap_BR invoiceMap;
    FiscalDocumentLine_BR fiscalDocumentLine;

    for (invoiceMap = fiscalDocument_br_customer_ds.getFirst(1); invoiceMap; invoiceMap =  fiscalDocument_br_customer_ds.getNext())
    {
        for (fiscalDocumentLine = FiscalDocumentLine_BR_Customer_ds.getFirst(1); fiscalDocumentLine; fiscalDocumentLine =  FiscalDocumentLine_BR_Customer_ds.getNext())
        {
            icmsAdjustmentCreateFromFiscalDoc.addFromInvoiceMap(invoiceMap, fiscalDocumentLine);
        }
    }

    for (invoiceMap = fiscalDocument_br_vendor_ds.getFirst(1); invoiceMap; invoiceMap =  fiscalDocument_br_vendor_ds.getNext())
    {
        for (fiscalDocumentLine = FiscalDocumentLine_BR_Vendor_ds.getFirst(1); fiscalDocumentLine; fiscalDocumentLine =  FiscalDocumentLine_BR_Vendor_ds.getNext())
        {
            icmsAdjustmentCreateFromFiscalDoc.addFromInvoiceMap(invoiceMap, fiscalDocumentLine);
        }
    }
}

private boolean validateOneFiscalDocumentSelected()
{
    boolean headerFound, lineFound;

    InvoicesReferencedByMap_BR invoiceMap;
    FiscalDocumentLine_BR fiscalDocumentLine;

    boolean ok = true;

    for (invoiceMap = fiscalDocument_br_customer_ds.getFirst(1); invoiceMap; invoiceMap =  fiscalDocument_br_customer_ds.getNext())
    {
        if (headerFound)
        {
            ok = checkFailed("@Brazil:FBCIAPFiscalDocumentValidation");
        }

        headerFound = true;

        for (fiscalDocumentLine = FiscalDocumentLine_BR_Customer_ds.getFirst(1); fiscalDocumentLine; fiscalDocumentLine = FiscalDocumentLine_BR_Customer_ds.getNext())
        {
            if (lineFound)
            {
                ok = checkFailed("@Brazil:FBCIAPFiscalDocumentLineValidation");
            }

            lineFound = true;
        }
    }

    for (invoiceMap = fiscalDocument_br_vendor_ds.getFirst(1); invoiceMap; invoiceMap =  fiscalDocument_br_vendor_ds.getNext())
    {
        if (headerFound)
        {
            ok = checkFailed("@Brazil:FBCIAPFiscalDocumentValidation");
        }

        headerFound = true;

        for (fiscalDocumentLine = FiscalDocumentLine_BR_Vendor_ds.getFirst(1); fiscalDocumentLine; fiscalDocumentLine = FiscalDocumentLine_BR_Vendor_ds.getNext())
        {
            if (lineFound)
            {
                ok = checkFailed("@Brazil:FBCIAPFiscalDocumentLineValidation");
            }

            lineFound = true;
        }
    }

    return ok;
}
